import CollectionItem from "./collection-item-style"
import React from "react"

const CollectionItemComponent = (props) => {
    return <CollectionItem>
        <h1>{props.object.title}</h1>
        {props.object.items.filter((item, index) => {
            return index < 4
        }).map(item => {
            return <div className="caption">
                <img className="img" src={item.imageURl} alt={item.name} />
                <span className="name">{item.name}</span>
                <span className="price">$ {item.price}</span>
            </div>

        })}
    </CollectionItem>
}
export default CollectionItemComponent
